import React from 'react';
import { useParams } from 'react-router-dom';

const spaces = [
  { id: 1, name: 'Garage Espacioso', description: 'Amplio y seguro.', location: 'Ciudad de México', price: '$100', image: 'https://via.placeholder.com/800x600' },
  { id: 2, name: 'Almacén Seguro', description: 'Con seguridad 24/7.', location: 'Guadalajara', price: '$150', image: 'https://via.placeholder.com/800x600' },
  { id: 3, name: 'Espacio Premium', description: 'Ubicación céntrica.', location: 'Monterrey', price: '$200', image: 'https://via.placeholder.com/800x600' },
];

const SpaceDetails = () => {
  const { id } = useParams();
  const space = spaces.find((s) => s.id === parseInt(id));

  return (
    <div className="container mx-auto p-8">
      <img src={space.image} alt={space.name} className="w-full h-64 object-cover rounded-lg mb-6" />
      <h1 className="text-3xl font-bold mb-4">{space.name}</h1>
      <p className="text-gray-700 mb-2">{space.description}</p>
      <p className="text-blue-500 font-bold">{space.price}/mes</p>
      <p className="text-gray-500">Ubicación: {space.location}</p>
    </div>
  );
};

export default SpaceDetails;
